import React from 'react';

function Home() {
  return (
    <div>
      <h2>Welcome to ExtremeGEOTools</h2>
      <p>
        Run competitive intelligence queries, capture sources, and track costs across engines.
        Use the Query page to run a search and see a live cost estimate as you type.
        The Costs page shows total spend aggregated from completed runs.
      </p>
    </div>
  );
}

export default Home;
